class PDTag extends PrivateTag {
  /// The [PCTag.name]
  final PCTag creator;
  final PDTagKnown pdTagDefinition;

  PDTag(int code, VR vr, [PCTag creator])
      : creator = (creator == null) ? new PCTag(code, vr, "Unknown Creator") :
  creator,
        pdTagDefinition = (creator == null)
            ? PDTagKnown.kNoCreator
            : creator.lookupData(code),
        super(code, vr);

  @override
  VM get vm => pdTagDefinition.vm;

  @override
  String get name =>
      (pdTagDefinition == null) ? 'Unknown' :pdTagDefinition.name;

  @override
  bool get isPrivateData => true;

  @override
  bool get isKnown => pdTagDefinition != PDTagKnown.kUnknown;

  int get offset => code & 0xFF;
  String get offsetHex => Uint8.hex(offset);

  VR get expectedVR => pdTagDefinition.vr;
  int get expectedGroup => pdTagDefinition.group;
  int get expectedOffset => pdTagDefinition.offset;

  String get token => pdTagDefinition.token;

  @override
  int get index => pdTagDefinition.index;

  @override
  bool get isValid => creator.isValidDataCode(code);

  @override
  String get info =>
      '$runtimeType$dcm $groupHex, "$token", subgroup($subgroupHex), '
          'offset($offsetHex), $vr, $vm, "$name"';

  @override
  String toString() => '$runtimeType$dcm $name $subgroup($subgroupHex), creator'
      '(${creator.name})';

  static PDTag maker(int code, VR vr, [PCTag creator]) =>
      new PDTag(code, vr, creator);
}

